const cartItem = () => {
    return localStorage.getItem("cartitems")
}

const CartReducer = (state = 0,action) => {
    switch(action.type){
        case 'FETCH_ALL_CART':
            return state
        case 'ADD_CART':
            return state
        case 'DELETE_CART':
            return state
        case 'UPDATE_CART':
            return state
        default:
            return state
    }
}

export default CartReducer
